import React from "react";
import "./ExpBody.css";
import Card from "react-bootstrap/Card";

const ExpBody: React.FC = () => {
  return (
    <Card>
      <Card.Title>TITLE</Card.Title>
      <Card.Header>YEARS</Card.Header>
      <Card.Body>DESC</Card.Body>
    </Card>
  );
};

export default ExpBody;
